import React, { Component } from 'react';
import './App.css';

var data = new Date();
var data = dia + '/' + (mes+1) + '/' + ano4;
class App extends Component {
  render() {
    return (
      <div className="App">
       <h1>{data.getDate()}/{data.getMonth()}/</h1>
      </div>
    );
  }
}

export default App;
